			dc.w	0			; 4  reloc has been done
			dc.w	0			; 6  current music BPM
			dc.l	0			; 8  byte stream
			dc.l	0			; 12 m_lfmDmaConPatch
			dc.l	0			; 16 word stream
			dc.l	0			; 20 word stream loop
			dc.l	0			; 24 byte stream loop

; WARNING: in word stream, instrument offset is shifted by -12 bytes (3 last long of .LSPVars)
.LSP_InstrumentInfo:			; (15 instruments)
			dc.w	$0000,$0004,$1609,$0000,$0004,$0001
			dc.w	$0000,$2c16,$1ff0,$0000,$5484,$0bb9
			dc.w	$0000,$6bf6,$1312,$0000,$8316,$0782
			dc.w	$0000,$921a,$14ab,$0000,$a3ce,$0bd1
			dc.w	$0000,$bf26,$08bc,$0000,$bf26,$0001
			dc.w	$0000,$d09e,$0a52,$0000,$dabe,$0542
			dc.w	$0000,$ed2e,$05cf,$0000,$ed2e,$0001
			dc.w	$0000,$f8cc,$038d,$0000,$f8cc,$0001
			dc.w	$0000,$ffe6,$0399,$0000,$ffe6,$0001
			dc.w	$0001,$0718,$0734,$0001,$0718,$0001
			dc.w	$0001,$1580,$097d,$0001,$1580,$0001
			dc.w	$0000,$bb70,$01db,$0000,$bf06,$0010
			dc.w	$0000,$e542,$03f6,$0000,$e542,$0001
			dc.w	$0001,$287a,$0143,$0001,$28c0,$0010
			dc.w	$0001,$2b00,$09c9,$0001,$2c74,$090f

.resetv:	dc.l	0,0,0,0

; a0: music data (any mem)
; a1: sound bank data (chip mem)
; a2: 8bit DMACON byte address
.LSP_PlayerInit:
			move.l	#$58b8ca1f,d0
			cmp.l	(a1),d0
			bne.s	.dataError
			cmpi.l	#'LSP1',(a0)+
			bne.s	.dataError
			cmp.l	(a0)+,d0
			bne.s	.dataError
			lea		852(a0),a0		; skip header
			lea		.LSPVars(pc),a3
			move.l	a2,12(a3)
			move.l	a0,16(a3)		; word stream ptr
			movea.l	a0,a4
			add.l	#36334,a4
			move.l	a4,8(a3)		; byte stream ptr

			move.l	a0,(a3)	; word stream loop ptr
			move.l	a4,24(a3)	; byte stream loop ptr
			tst.b	4(a3)
			bne.s	.noReloc
			st		4(a3)
			moveq	#15-1,d0
			lea		.LSP_InstrumentInfo(pc),a0
			move.l	a1,d1
.rloop:		add.l	d1,(a0)
			add.l	d1,6(a0)
			lea		12(a0),a0
			dbf		d0,.rloop
.noReloc:	bset.b	#1,$bfe001	; disable this fucking Low pass filter!!
			lea		.LSPVars+6(pc),a0
			move.w	#125,(a0)		; music BPM
			rts

